import "./Board.css";

class Board extends Component {
    styles = {
        position: "absolute",
        top: "50%",
        left: "50%",
        transform: "translate(-50%, -50%)",
        width: "1000px",
        height: "1000px",
        border: "solid 20px black",
        background: "burlywood"
    };
    render() {
        return <div id="Board"></div>;
    }
}

export default <Board/>;
